    chart.data = [
        {
            dress: "Chloe Dress",
            value: 119820
        },
        {
            dress: "Violette Blazer",
            value: 60994
        },
        {
            dress: "Jessie Jumpsuit",
            value: 28033
        },
        {
            dress: "Maryanne",
            value: 25959
        },
        {
            dress: "Adele",
            value: 20176
        },
        {
            dress: "Sienna Rose",
            value: 16905
        }
    ];
    chart.radius = am4core.percent(70);
    chart.innerRadius = am4core.percent(40);
    chart.startAngle = 180;
    chart.endAngle = 360;

